import React from 'react';
import Skeleton from '@material-ui/lab/Skeleton';

function SkeletonLoading() {
  return (
    <div>
      <Skeleton
        animation='wave'
        height={30}
        width='80%'
        style={{ marginTop: 40 }}
      />
      <Skeleton
        animation='wave'
        height={30}
        width='80%'
        style={{ marginTop: 20 }}
      />
      <Skeleton
        animation='wave'
        height={400}
        width='100%'
        style={{ marginTop: -40 }}
      />
    </div>
  );
}

export default SkeletonLoading;
